    public class Solution_00030_FindSubstringTest
    {
        Solution_00030_FindSubstring obj = new Solution_00030_FindSubstring();

        [Fact]
        public void Case_01()
        {
            var s = "barfoothefoobarman";
            var nums = new List<string>() { "foo", "bar" };

            var result = obj.FindSubstring(s, nums.ToArray());

            Assert.Equal(2, result.Count);
            Assert.Equal("09", IntListToString(result));
        }

        [Fact]
        public void Case_02()
        {
            var s = "wordgoodgoodgoodbestword";
            var nums = new List<string>() { "word", "good", "best", "word" };

            var result = obj.FindSubstring(s, nums.ToArray());

            Assert.Equal(0, result.Count);
        }

        [Fact]
        public void Case_03()
        {
            var s = "wordgoodgoodgoodbestword";
            var nums = new List<string>() { "word", "good", "best", "good" };

            var result = obj.FindSubstring(s, nums.ToArray());

            Assert.Equal(1, result.Count);
            Assert.Equal("8", IntListToString(result));
        }

       
        [Fact]
        public void Case_05()
        {
            var s = "barfoofoobarthefoobarman";
            var nums = new List<string>() { "bar", "foo", "the" };

            var result = obj.FindSubstring(s, nums.ToArray());

            Assert.Equal(3, result.Count);
            Assert.Equal("6912", IntListToString(result));

        }

        [Fact]
        public void Case_06()
        {
            var s = "aaa";
            var nums = new List<string>() { "aa", "aa" };

            var result = obj.FindSubstring(s, nums.ToArray());

            Assert.Equal(0, result.Count);
